import React from 'react';
import './App.css';
import { Box, Button, Container } from '@mui/material';

function App() {
  return (
    <div className="App" style={{alignContent: 'center'}}>
      <Box m={1}>
        <Button variant="contained" style={{backgroundColor:'#424242'}}>
          42 Connect
        </Button>
      </Box>
    </div>
  );
}

export default App;
